import React, { Component } from "react";
import classes from "./NavigationItems.module.css";
import NavigationItem from "./NavigationItem/NavigationItem";
import { connect } from "react-redux";
class NavigationItems extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    let links = [];
    if (this.props.token) {
      links = [{ link: "logout", label: "Log out" }, {link: "login", label: "Home"}];
    } else {
      links = ["/login", "/auth"];
    }
    let linksElements = links.map((link, id) => {
      return (
        <NavigationItem {...this.props} link="/login">
          Sign in
        </NavigationItem>
      );
    });
    return (
      <nav
        className={
          this.props.clicked
            ? [classes.active, classes.headerMenu].join(" ")
            : classes.headerMenu
        }
      >
        <ul className={classes.NavigationItems}>
          <NavigationItem {...this.props} link="/login">
            Sign in
          </NavigationItem>
          <NavigationItem {...this.props} link="/auth">
            Sign up
          </NavigationItem>
        </ul>
      </nav>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    token: state.token,
    userId: state.userId,
  };
};

export default connect(mapStateToProps)(NavigationItems);
